import { EXCHANGE_CALCULATE_FROM } from "./types";

const initialState = {
    from: 'USD',
}

export const ratesReducer = (state = initialState, action) => {
    switch(action.type) {
        case EXCHANGE_CALCULATE_FROM:
            return {
                ...state, from: action.currency
            }
        default: return state;
    }
}
